const Actions = {
  GET_RATE_REQUEST: 'GET_RATE_REQUEST',
  GET_RATE_RESPONSE: 'GET_RATE_RESPONSE',

  getRateAction: () => ({
    type: Actions.GET_RATE_REQUEST
  })
};

export default Actions;
